import React, { Component } from 'react';
import './testimonial.css';
import AVaTaR1 from '../../assets/Avatar.png';
import AVaTaR2 from '../../assets/Avatar.png';
import AVaTaR3 from '../../assets/Avatar.png';

// import Swiper core and required modules

import { Swiper, SwiperSlide, swiperSlide } from 'swiper/react';
import { Pagination } from 'swiper';
import SwiperCore from 'swiper';
import "swiper/swiper-bundle.css";
import "./styles.css";




const data = [
	{
	avatar: AVaTaR1 ,
	name: 'Ernest Achiever',
	review: 'Lorem ipsum dolor sit ekfdicvdkomv dfg midgmfipogvb dkf mpddkm fd'
 	},
	{
	Avatar: AVaTaR2 ,
	name: 'Ernest Achiever',
	review: 'Lorem ipsum dolor sit ekfdicvdkomv dfg midgmfipogvb dkf mpddkm fd'
 	}
	]




	const Testimonial = ()=> {
		const slides = [];

		for (let i = 0; i < 5; i += 1) {
			slides.push(
				<SwiperSlide key={`slide-${i}`}>
					<img src={Avatar} alt={`Slide ${i}`} />
				</SwiperSlide>
			)
		}

        return (
             <section id='testimonial' >
               <h5>Review from clients</h5>
               <h2>Testimonial</h2>

	       <Swiper className="container testimonial__container"
               // install Swiper modules
               modules={[ Pagination ]}
      	       spaceBetween={40}
      	       slidesPerView={1}
                pagination={{ clickable: true }} id="main"> 

				{slides}
	       </Swiper>
            </section> 
        )}
export default Testimonial;
